import axios from '../../api/axios';
import React, { useEffect, useState } from 'react';
import {
  Table,
  TableHead,
  TableBody,
  TableRow,
  TableCell,
  Paper,
  Typography,
  Box
} from '@mui/material';
const PortfolioScreen = () => 
{
  const [portfolio, setPortfolio] = useState([]);
  const [summary, setSummary] = useState({});
  const [error, setError] = useState('');
  const fetchPortfolio = async () => 
    {
    try {
      const token = localStorage.getItem('token');
      const res = await axios.get('http://localhost:5000/api/portfolio', {
        headers: {
          Authorization: `Bearer ${token}`
        }
      });
      const portfolioData = res.data?.portfolio;
      const summaryData = res.data?.summary;

      if (Array.isArray(portfolioData)) {
        setPortfolio(portfolioData);
        setSummary(summaryData || {});
        setError('');
      } else {
        setPortfolio([]);
        setSummary({});
        setError('Portfolio data is missing or invalid from API.');
      }
    } catch (err) {
      console.error('Failed to fetch portfolio:', err);
      setError('Error fetching portfolio. Make sure you are logged in.');
    }
  };

  useEffect(() => {
    fetchPortfolio();
    const interval = setInterval(fetchPortfolio, 6000);
    return () => clearInterval(interval);
  }, []);

  return (
    <Box p={3}>
      <Typography variant="h5" gutterBottom>Virtual Portfolio</Typography>

      {error && (
        <Typography color="error" variant="body1">{error}</Typography>
      )}

      <Paper>
        <Table>
          <TableHead>
            <TableRow>
              <TableCell>Symbol</TableCell>
              <TableCell>Qty</TableCell>
              <TableCell>Avg Buy Price</TableCell>
              <TableCell>Current Price</TableCell>
              <TableCell>Market Value</TableCell>
              <TableCell>Unrealized P/L</TableCell>
            </TableRow>
          </TableHead>
          <TableBody>
            {portfolio.map((row, i) => (
              <TableRow key={i}>
                <TableCell>{row.symbol}</TableCell>
                <TableCell>{row.qty}</TableCell>
                <TableCell>${row.avgBuyPrice}</TableCell>
                <TableCell>${row.currentPrice}</TableCell>
                <TableCell>${row.marketValue}</TableCell>
                <TableCell
                  style={{ color: row.unrealizedPL >= 0 ? 'green' : 'red' }}
                >
                  ${row.unrealizedPL}
                </TableCell>
              </TableRow>
            ))}
          </TableBody>
        </Table>
      </Paper>

      <Box mt={3}>
        <Typography><strong>Total Invested:</strong> ${summary.totalInvested ?? 0}</Typography>
        <Typography><strong>Market Value:</strong> ${summary.totalMarketValue ?? 0}</Typography>
        <Typography style={{ color: (summary.totalPL ?? 0) >= 0 ? 'green' : 'red' }}>
          <strong>Total P/L:</strong> ${summary.totalPL ?? 0}
        </Typography>
      </Box>
    </Box>
  );
};

export default PortfolioScreen;
